import styled from '@emotion/styled'

function Header() {
    return(
        <HeaderStyled>
            <div className = "container">
                <div className = "logo">
                    <span className = "logo-text">
                        CodeBoard
                    </span>
                </div>
            </div>
        </HeaderStyled>
    )
}

const HeaderStyled = styled.header`
    background: #efefe;
    padding: 20px;
    .logo{
        display: flex;
        align-items: center;
    }
`

export default Header
